import React, {useState,useEffect} from 'react';

function Header(props){

    let [hero,setHero] = useState(null)

    useEffect(()=>{
        fetch("http://localhost:3000/stock/63b95c3e0ab9e178767f97f5").then((response)=> {
            (response.json())})
        .then(setHero)
    },[])

  

    // const Hero = ()=>{
    //     if (hero === "Devil"){
    //         setHero("Hero")
    //     }
    //     else{
    //         setHero("Devil")
    //     }
    // } 
    return (
        <div>
            <h1>{props.name} {hero}</h1>
            <h1>{JSON.stringify(hero)}</h1>
            <ul>
                {props.list.map( (dish) => (<li key={dish.id}>
                    {dish.dish}
                </li>))}
            </ul>

            {/* <button onClick = {Hero}>staeChange</button> */}
        </div>    
    );
}

function TestingCondition(props){
    return (
        <div>{props.condition ? <h1>killer</h1>:<h2>king</h2>}</div>
    )
}

//export default Header;
export  {TestingCondition,Header}
